n            </tr>\n    </tbody>\n</table></td>\n                                        </tr>\n                                    </table>\n                                    <!--[if (gte mso 9)|(IE)]>\n                                    </td>\n                                    </tr>\n                                    </table>\n                                    <![endif]-->\n                                </td>\n                            </tr>\n                            <tr>\n                                <td align=\"center\" valign=\"top\" id=\"templateBody\" data-template-container>\n                                    <!--[if (gte mso 9)|(IE)]>\n                                    <table align=\"center\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"600\" style=\"width:600px;\">\n                                    <tr>\n                                    <td align=\"center\" valign=\"top\" width=\"600\" style=\"width:600px;\">\n                                    <![endif]-->\n                                    <table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"templateContainer\">\n                                        <tr>\n                                            <td valign=\"top\" class=\"bodyContainer\"><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnImageBlock\" style=\"min-width:100%;\">\n    <tbody class=\"mcnImageBlockOuter\">\n            <tr>\n                <td valign=\"top\" style=\"padding:0px\" class=\"mcnImageBlockInner\">\n                    <table align=\"left\" width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnImageContentContainer\" style=\"min-width:100%;\">\n                        <tbody><tr>\n                            <td class=\"mcnImageContent\" valign=\"top\" style=\"padding-right: 0px; padding-left: 0px; padding-top: 0; padding-bottom: 0; text-align:center;\">\n                                \n                                    \n                                        <img align=\"center\" alt=\"\" src=\"https://gallery.mailchimp.com/779fd6df0a3fdb74c0f5021ef/images/b6b3e89a-d38a-4823-81b2-9f57b5270f1a.png\" width=\"588\" style=\"max-width:1024px; padding-bottom: 0; display: inline !important; vertical-align: bottom;\" class=\"mcnImage\">\n                                    \n                                \n                            </td>\n                        </tr>\n                    </tbody></table>\n                </td>\n            </tr>\n    </tbody>\n</table><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnDividerBlock\" style=\"min-width:100%;\">\n    <tbody class=\"mcnDividerBlockOuter\">\n        <tr>\n            <td class=\"mcnDividerBlockInner\" style=\"min-width:100%; padding:18px;\">\n                <table class=\"mcnDividerContent\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" style=\"min-width: 100%;border-top: 2px solid #222222;\">\n                    <tbody><tr>\n                        <td>\n                            <span></span>\n                        </td>\n                    </tr>\n                </tbody></table>\n<!--            \n                <td class=\"mcnDividerBlockInner\" style=\"padding: 18px;\">\n                <hr class=\"mcnDividerContent\" style=\"border-bottom-color:none; border-left-color:none; border-right-color:none; border-bottom-width:0; border-left-width:0; border-right-width:0; margin-top:0; margin-right:0; margin-bottom:0; margin-left:0;\" />\n-->\n            </td>\n        </tr>\n    </tbody>\n</table><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnTextBlock\" style=\"min-width:100%;\">\n    <tbody class=\"mcnTextBlockOuter\">\n        <tr>\n            <td valign=\"top\" class=\"mcnTextBlockInner\" style=\"padding-top:9px;\">\n              	<!--[if mso]>\n				<table align=\"left\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\" style=\"width:100%;\">\n				<tr>\n				<![endif]-->\n			    \n				<!--[if mso]>\n				<td valign=\"top\" width=\"600\" style=\"width:600px;\">\n				<![endif]-->\n                <table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"max-width:100%; min-width:100%;\" width=\"100%\" class=\"mcnTextContentContainer\">\n                    <tbody><tr>\n                        \n                        <td valign=\"top\" class=\"mcnTextContent\" style=\"padding: 0px 18px 9px;color: #655757;\">\n                        \n                            <table border=\"1\" cellpadding=\"0\" cellspacing=\"0\">\n	<tbody>\n		<tr>\n			<td style=\"width:578px;height:199px;\"><br>\n			Dear {visitorname}:<br>\n			&nbsp;<br>\n			Thank you for&nbsp;your inquiry to visit our Akshardham Complex in Robbinsville, NJ.&nbsp; It is our pleasure to accommodate your group of {tourmember} persons on {startdate}.&nbsp; {tourmanager} will be your tour manager and will contact you to detail the tour.&nbsp; {tourmanager} can be reached via email, {manageremail}, or phone, {managerphone}.<br>\n			&nbsp;<br>\n			While the whole experience as described below can take up to one and half hour, {tourmanager} can help you customize your visit based on your specific requirements and available time.&nbsp;&nbsp; A tour can include the following:\n			<ol>\n				<li>10 min - Video Introduction of Mandir and its construction</li>\n				<li>30 min - Guided Mandir Tour</li>\n				<li>05 min - Abhishek, a Hindu tradition of pouring pure water on sacred images</li>\n				<li>15 min - Aarti, a traditional Hindu service observed at 11:30 am and 7:00 pm<a href=\"#_ftn1\" name=\"_ftnref1\" title=\"\">[1]</a></li>\n				<li>20 min - Q and A</li>\n				<li>30 min – Exploring the gift shop and café</li>\n			</ol>\n			&nbsp;<br>\n			For details about the mandir please review the brochure <a href=\"https://www.dropbox.com/s/oqjjeb5bvw95494/MandirBrochureOnePager.pdf?dl=0\" target=\"_blank\">here</a>. Check out café services menu <a href=\"https://www.dropbox.com/s/kw699a0t786lob5/Shayona%20Weekday%20Menu%20ONLY.pdf?dl=0\" target=\"_blank\">here</a><br>\n			<br>\n			We look forward to your visit and please feel free to call us at +1 609.918.1212 if you have any questions.&nbsp;\n			<div><br>\n			Sincerely,<br>\n			<br>\n			BAPS Robbinsville Tour Group\n			<hr align=\"left\" size=\"1\" width=\"33%\">\n			<div id=\"ftn1\"><a href=\"#_ftnref1\" name=\"_ftn1\" title=\"\">[1]</a> For the 11:30 am Aarti it is recommended that the tour begin at 10:30 am and likewise for the 7:00 pm Aarti the tour should begin by 6:00 pm</div>\n			</div>\n			<br>\n			&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n                        </td>\n                    </tr>\n                </tbody></table>\n				<!--[if mso]>\n				</td>\n				<![endif]-->\n                \n				<!--[if mso]>\n				</tr>\n				</table>\n				<![endif]-->\n            </td>\n        </tr>\n    </tbody>\n</table><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" class=\"mcnImageBlock\" style=\"min-width:100%;\">\n    <tbody class=\"mcnImageBlockOuter\">\n            <tr>\n                <td valign=\"top\" style=\"padding:0px\" class=\"mcnImageBlockInner\">\n                    <table align=\"left\" width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mcnImageContentContainer\" style=\"min-width:100%;\">\n                        <tbody><tr>\n                            <td class=\"mcnImageContent\" valign=\"top\" style=\"padding-right: 0px; padding-left: 0px; padding-top: 0; padding-bottom: 0; text-align:center;\">\n                                \n                                    \n                                        <img align=\"center\" alt=\"\" src=\"https://gallery.mailchimp.com/779fd6df0a3fdb74c0f5021ef/images/649804e4-8bc7-48a0-94ab-7071fc0bd9e0.png\" width=\"600\" style=\"max-width:827px; padding-bottom: 0; display: inline !i