INSERT INTO `tour_notes` VALUES (1,2,'WhatsApp message from P. Neelkanthseva Swami on June17, 2019',2,2,1,'2019-06-18 05:35:54','2019-06-18 05:35:54'),(2,6,'*GROUP DETAILS:-*\n*Surbhi-Unitarian Montessori School Educators*\n*Wednesday,June 19th at 11.30 am.*\n\n*15 Guest\'s.*\nContact Name: Surbhi\nOrganization: Unitarian Montessori School\nAddress: 176 Tices Lane\nCity: East Brunswick\nState/Province: NJ\nZip/Postal Code: 08831\nTelephone: 9087204425\nEmail: Surbhi.saini@comcast.net\nType of Group: Other\n        Number of adults (18-65): 14-15\nTotal Guest: 15\nPrimary Date: 06/19/2019\nPrimary Visiting Time: 11:45 AM\nHear about us: Other groups that have visited\nQuestion/Comments: This is a staff at the montessori school, I am the director and I would like to share our culture with my staff, would appreciate if this can be confirmed..\n*PLAN:-*\n*1)Mandir intro video,*\n*2)Abhishek,*\n*3)Mandir darshan tour,*\n*4)Aarti,*\n*5)Q&A,*\n\n*6)Shayona & gift center.*',3,3,1,'2019-06-18 21:49:42','2019-06-18 21:49:42'),(3,15,'Here is menu for tomorrow \n\n\nCONFIRMED \n404-438-9632\n6/26/2019\nWednesday\nUSA Grand Tours \n\n22\n12:00 PM\nLadoo\nRotli\nLilva Kachori\nSweet Chutney\nUndhiyu\nPlain Rice\nGujarati Daal\nPapad Papdi\nMukhwas\n\nPlates\nBowls\nSpoons\nNapkins',3,3,1,'2019-06-26 15:55:04','2019-06-26 15:55:04'),(4,20,'BAPS Shri Swaminarayan Mandir,Robbinsville,NJ.USA\nGuest Summary-Wednesday,July 3rd\n\nGuest:- BAPS Paris Mandal Center Co-ordinator.\nGuest Numbers:- 2\nContact details:-+1-Not available\nRecommendation:-Pujya Paramseva Das Swami .\nTime:- Approx :- No known,\nTransportation:- Own transportation.\nPlan:-\n1)Abhishek,\n2)Mandir guided tour,\n3)Aarti,\n4)Sant Mulakat-Will meet P.NSD Swami,\n5)Lunch,\n6)Prasad bag,',3,3,1,'2019-07-03 14:55:53','2019-07-03 14:55:53'),(5,27,'PR Guest from Atlantic City-Hotelier & Builder',3,3,1,'2019-07-10 16:25:52','2019-07-10 16:25:52'),(6,29,'General Anbu will be accompanied by his wife Gawri and their daughter Pooja. Avnish Gupta CEO of EZ ride will be coordinate this tour for General',2,2,1,'2019-07-13 18:30:28','2019-07-13 18:30:28'),(7,29,'Avnishbhai has requested a meeting with Swami',2,2,1,'2019-07-13 18:30:54','2019-07-13 18:30:54'),(8,32,'School is mainly composed of 1/3 Caucasian, 1/3 Jewish, and 1/3 Indian',23,23,1,'2019-07-14 17:39:09','2019-07-14 17:39:09'),(9,32,'Main Point of Contact is Harry',23,23,1,'2019-07-14 17:39:51','2019-07-14 17:39:51'),(10,32,'Joe is the Nurse',23,23,1,'2019-07-14 17:41:44','2019-07-14 17:41:44'),(11,40,'External DJ: Nilkanth Patel, nnp@mailinator.com; 610-555-1212.  Will come to setup at 7:30am and work with RBV AV Lead',2,2,1,'2019-07-26 23:34:13','2019-07-26 23:34:13'),(12,40,'External Decorator:  Preeti Patel, pmp@mailinator.com, 732-222-1313; will come to mandir at 7:30 am',2,2,1,'2019-07-26 23:34:13','2019-07-26 23:34:13'),(13,40,'Event Setup Time:  7:00 am to 8:30 pm\nEvent time:  9:00 am to 1:30 pm\nEngagement: 9:00 am to 10:30 am\nBlessing from swamis: 10:30 am to 11:00 am\nPhoto session:  11:00 am to 12:00 noon\nLunch: 11:30 am to 1:30 pm\nClean up: 12:00 noon to 2:30 pm',2,2,1,'2019-07-26 23:34:13','2019-07-26 23:34:13'),(14,43,'The phone # provided in the Visitor\'s tab is Angel Dodson\'s, Cardinal-Secretary of State',23,23,1,'2019-07-31 18:02:32','2019-07-31 18:02:32'),(15,43,'Sanjivbhai will be arranging pickup from Airport with one of our Haribhakto\'s car',23,23,1,'2019-08-02 17:51:46','2019-08-02 17:51:46'),(16,54,'The visitors center is open to the general public.  It is important to know that the individuals who visit our Mandir come from all religion, denominations and ethnic background.  Our scheduled tours also represent a large variety of organizations including Schools, Universities, Religious Organizations, Indian Organizations, Corporations, and many others.',2,2,1,'2019-11-09 21:05:46','2019-11-09 21:05:46'),(17,54,'This group is interested in Walkathon and offering any other type of volunter service',2,2,1,'2019-11-09 21:05:46','2019-11-09 21:05:46'),(18,55,'The visitors center is open to the general public.  It is important to know that the individuals who visit our Mandir come from all religion, denominations and ethnic background.  Our scheduled tours also represent a large variety of organizations including Schools, Universities, Religious Organizations, Indian Organizations, Corporations, and many others.',2,2,1,'2019-11-09 21:06:19','2019-11-09 21:06:19'),(19,55,'This group is interested in Walkathon and offering any other type of volunter service',2,2,1,'2019-11-09 21:06:19','2019-11-09 21:06:19'),(20,56,'test notes added by rohit',1,1,1,'2019-11-12 13:10:23','2019-11-12 13:10:23'),(21,68,'test notes',1,1,1,'2019-12-15 18:17:09','2019-12-15 18:17:09'),(22,79,'Please make sure that iSide guides are available',2,2,1,'2020-01-11 05:39:00','2020-01-11 05:39:00'),(23,86,'•	If the request is from BAPS website this message to the requestor (Visitor Contact) will be sent from baps.org.\n•	If the request is manually entered in TMS this message will be sent to the Visitor Contact when the tour is added.',26,26,1,'2020-02-08 18:28:30','2020-02-08 18:28:30'),(24,86,'•	If the request is from BAPS website this message to the requestor (Visitor Contact) will be sent from baps.org.\n•	If the request is manually entered in TMS this message will be sent to the Visitor Contact when the tour is added.',26,26,1,'2020-02-08 18:28:44','2020-02-08 18:28:44');
